@Component({
  selector: 'app-footer',
  templateUrl: './footer.component.html',
  styleUrls: ['./footer.component.scss'],
})
export class FooterComponent implements OnInit {
  constructor() {}

  ngOnInit() {}
}
<div class="container">
  <footer class="d-flex flex-wrap justify-content-between align-items-center py-3 my-4 border-top">
    <div class="col-md-4 d-flex align-items-center">
      <a href="/" class="mb-3 me-2 mb-md-0 text-muted text-decoration-none lh-1">
        <img src="./assets/images/brujula.jpg" alt="">
      </a>
      <span class="mb-3 mb-md-0 text-muted">Talleres MAFAH</span>
    </div>

    <ul class="nav col-md-4 justify-content-end list-unstyled d-flex">
      <a href="#" style="margin: 10px" ><i class="fa-brands fa-twitter"></i></a>
      <a href="#"><i style="margin: 10px"  class="fa-brands fa-facebook"></i></a>
      <a href="#"><i style="margin: 10px" class="fa-brands fa-whatsapp"></i></a>
    </ul>
  </footer>
</div>
